jobInfo.postDescription:
JAVA工程师
岗位职责：
1）协助完成需求的整理和软件设计;
2）按照项目计划，按时提交高质量代码，完成开发任务，规范文档的编写、维护，以及其他与项目相关工作;
3）负责单元测试代码的编写和进行单元测试;
4）协助负责java程序的打包、发布和部署工作;
任职要求：
1）本科及以上，应届毕业生即可，计算机相关专业，有实习经验;
2）了解HTML5、JavaScript、Ajax、CSS、Vue等Web前端技术;
3）熟练掌握Java/J2EE编程，熟悉Java多线程、Socket通信等技术
4）了解springboot/springmvc/mybatis/netty等开源框架，阅读过相关源码
5）熟练使用dubbo 框架
6）了解Java常用的设计模式;熟悉Redis, Elasticsearch并了解各自使用场景
7）熟悉常见消息队列的使用例如RocketMq、Mqtt等
8）熟练使用MySQL等数据库开发、SQL性能调优；
9）熟练使用Maven, GIT代码管理工具;
10）强烈的责任心与团队精神，较强的抗压能力和良好的沟通、协调、组织能力;
11）有物联网行业从业经验优先；
